const { jsPDF } = window.jspdf;

(function (jsPDFAPI) {
  var font = ''; // base64 
  // 2. Register the font
  jsPDFAPI.addFileToVFS("Adigiana2-Regular.ttf", font);
  jsPDFAPI.addFont("Adigiana2-Regular.ttf", "Adigiana2", "normal");

  // 3. Set the font as available
  jsPDFAPI.pdf.setFont("Adigiana2");
})(jsPDF.API);